INSERT INTO `sheet` VALUES (1063,0,0,NULL,'Heer, hoe talrijk zijn mijn vijanden\nen velen die opstaan tegen mij.\nZij, die spotten en zeggen van mij\nhij vindt geen hulp bij zijn God.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,906,NULL,NULL,'2020-01-11 19:34:17','2020-01-11 21:20:20',NULL,'Heer, hoe talrijk zijn mijn vijanden','SheetTitleContent',NULL,NULL),(1064,0,1,NULL,'Maar U, o Heer bent een schild voor mij\nmijn Redder en Bevrijder elke dag.\nWant U, o Heer bent een schild voor mij\nmijn Redder en Bevrijder elke dag.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,906,NULL,NULL,'2020-01-11 19:34:17','2020-01-11 21:20:20',NULL,'Maar U, o Heer bent een schild voor mij','SheetTitleContent',NULL,NULL),(1065,0,2,NULL,'Ik ben niet bang voor tienduizenden mensen\ndie zich stellen rondom mij.\nAls ik luide roep tot God\ndan antwoord Hij mij van Zijn heil’ge berg.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,906,NULL,NULL,'2020-01-11 19:34:17','2020-01-11 21:20:20',NULL,'Ik ben niet bang voor tienduizenden mensen','SheetTitleContent',NULL,NULL),(1066,0,3,NULL,'Ik ben niet bang voor tienduizenden mensen\ndie zich stellen rondom mij.\nAls ik luide roep tot God\ndan antwoord Hij mij van Zijn heil’ge berg.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,906,NULL,NULL,'2020-01-11 19:34:17','2020-01-11 21:20:20',NULL,'Ik ben niet bang voor tienduizenden mensen','SheetTitleContent',NULL,NULL),(1067,0,4,NULL,'Maar U, o Heer bent een schild voor mij\nmijn Redder en Bevrijder elke dag.\nWant U, o Heer bent een schild voor mij\nmijn Redder en Bevrijder elke dag.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,906,NULL,NULL,'2020-01-11 19:34:17','2020-01-11 21:20:20',NULL,'Maar U, o Heer bent een schild voor mij','SheetTitleContent',NULL,NULL),(1068,0,5,NULL,'Heer, hoe talrijk zijn mijn vijanden\nen velen die opstaan tegen mij.\nZij, die spotten en zeggen van mij\nhij vindt geen hulp bij zijn God.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,906,NULL,NULL,'2020-01-11 19:34:17','2020-01-11 21:20:20',NULL,'Heer, hoe talrijk zijn mijn vijanden','SheetTitleContent',NULL,NULL),(1069,0,6,NULL,'Maar U, o Heer bent een schild voor mij\nmijn Redder en Bevrijder elke dag.\nWant U, o Heer bent een schild voor mij\nmijn Redder en Bevrijder elke dag.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,906,NULL,NULL,'2020-01-11 19:34:17','2020-01-11 21:20:20',NULL,'Maar U, o Heer bent een schild voor mij','SheetTitleContent',NULL,NULL),(1070,0,7,NULL,'Maar U, o Heer bent een schild voor mij\nmijn Redder en Bevrijder elke dag.\nWant U, o Heer bent een schild voor mij\nmijn Redder en Bevrijder elke dag.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,906,NULL,NULL,'2020-01-11 19:34:17','2020-01-11 21:20:20',NULL,'Maar U, o Heer bent een schild voor mij','SheetTitleContent',NULL,NULL),(1071,0,0,NULL,'Laat het los, laat het.\nJa ik reis uit de kilte op.\nLaat het los, laat het gaan.\nVolg deze hoge tol. \nHier begeert nu mijn leven weer.\nVrij en onbevreesd.\nKou is voor mij nooit een punt geweest.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,907,NULL,NULL,'2020-01-10 23:30:51','2020-01-12 10:37:14',NULL,'Laat het los, laat het.','SheetTitleContent',NULL,NULL),(1072,0,1,NULL,'Mijn kracht neemt toe,\nEn schept een zuilen rij van steen.\nMijn ziel bouwt een kasteel, \nVan ijskristallen om me heen.\nIn elk kristal weerklinkt de echo van mijn geest.\nGa nooit nee nooit terug,\nHet verleden is geweest',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,907,NULL,NULL,'2020-01-10 23:30:51','2020-01-12 10:37:14',NULL,'Mijn kracht neemt toe,','SheetTitleContent',NULL,NULL),(1073,0,2,NULL,'De sneeuw glanst zacht in het maanlicht vannacht,\nVan een voetstap geen blijk.\nDit lege verlaten land is,\nvanaf nu mijn koninkrijk.\nVan de storm die in mij woed,\nhad tot nu toe niemand weet.\nHet werd mij te veel hoe ik mijn best ook deed.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,907,NULL,NULL,'2020-01-10 23:30:51','2020-01-12 10:37:14',NULL,'De sneeuw glanst zacht in het maanlicht vannacht,','SheetTitleContent',NULL,NULL),(1074,0,3,NULL,'Ik ga op zoek naar wie ik ben,\nVerleg de grenzen die ik ken.\nGeen goed of fout geldt hier voor mij,\nIk ben vrij.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,907,NULL,NULL,'2020-01-10 23:30:51','2020-01-12 10:37:14',NULL,'Ik ga op zoek naar wie ik ben,','SheetTitleContent',NULL,NULL),(1075,0,4,NULL,'Laat niemand toe,\nSpreek niemand aan.\nWees gehoorzaam en ga hier niet vandaan.\nVoel niets, doe niets dat iets verraad. \nDas nu te laat.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,907,NULL,NULL,'2020-01-10 23:30:51','2020-01-12 10:37:14',NULL,'Laat niemand toe,','SheetTitleContent',NULL,NULL),(1076,0,5,NULL,'Laat het los, laat het gaan\nHet roer om moet om, \nja dat moet.\nLaat het los, laat het gaan.\nSluit de deuren nu voor goed.\nWat men daar,\nOver mij beweert.\nRaakt me hier niet meer.\nEn kou heeft me zowiezo nooit gedeerd.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,907,NULL,NULL,'2020-01-10 23:30:51','2020-01-12 10:37:14',NULL,'Laat het los, laat het gaan','SheetTitleContent',NULL,NULL),(1077,0,6,NULL,'Laat het los, laat het gaan.\nVoorbij is de storm in mij.\nLaat het los, laat het gaan.\nGeen grenzen meer voor mij.\nHier begeert mijn nieuwe bestaan.\nOnbevreesd en vrij.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,907,NULL,NULL,'2020-01-10 23:30:51','2020-01-12 10:37:14',NULL,'Laat het los, laat het gaan.','SheetTitleContent',NULL,NULL),(1078,0,7,NULL,'Het is grappig dat wat afstand,\nZo snel weer inzicht gaf.\nWant de vrees die mij steeds voort joeg,\nGlijd nu al van mij af.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,907,NULL,NULL,'2020-01-10 23:30:51','2020-01-12 10:37:14',NULL,'Het is grappig dat wat afstand,','SheetTitleContent',NULL,NULL),(1079,0,0,NULL,'Ik zing vol blijdschap en lach\nWant de vreugde van god is mijn kracht\nWij buigen neer aanbidden Hem nu\nHoe groot en machtig is Hij\nIedereen zingt, iedereen zingt',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,908,NULL,NULL,'2020-01-12 20:53:37','2020-01-12 20:53:37',NULL,'Ik zing vol blijdschap en lach','SheetTitleContent',NULL,NULL),(1080,0,1,NULL,'Heilig is de heer God almachtig\nDe aarde is vol van uw glorie\nHeilig is de heer God almachtig\nDe aarde is vol van uw glorie (2x)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,908,NULL,NULL,'2020-01-12 20:53:37','2020-01-12 20:53:37',NULL,'Heilig is de heer God almachtig','SheetTitleContent',NULL,NULL),(1081,0,2,NULL,'Ik zing vol blijdschap en lach\nWant de vreugde van god is mijn kracht\nWij buigen neer aanbidden Hem nu\nHoe groot en machtig is Hij\nIedereen zingt, iedereen zingt',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,908,NULL,NULL,'2020-01-12 20:53:37','2020-01-12 20:53:37',NULL,'Ik zing vol blijdschap en lach','SheetTitleContent',NULL,NULL),(1082,0,3,NULL,'Heilig is de heer God almachtig\nDe aarde is vol van uw glorie\nHeilig is de heer God almachtig\nDe aarde is vol van uw glorie (2x)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,908,NULL,NULL,'2020-01-12 20:53:37','2020-01-12 20:53:37',NULL,'Heilig is de heer God almachtig','SheetTitleContent',NULL,NULL),(1083,0,4,NULL,'Hij komt terug hij heeft het belooft\nVoor iedereen die in hem gelooft (2x)\nIedereen zingt, iedereen zingt',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,908,NULL,NULL,'2020-01-12 20:53:37','2020-01-12 20:53:37',NULL,'Hij komt terug hij heeft het belooft','SheetTitleContent',NULL,NULL),(1084,0,5,NULL,'Heilig is de heer God almachtig\nDe aarde is vol van uw glorie\nHeilig is de heer God almachtig\nDe aarde is vol van uw glorie (2x)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,908,NULL,NULL,'2020-01-12 20:53:37','2020-01-12 20:53:37',NULL,'Heilig is de heer God almachtig','SheetTitleContent',NULL,NULL),(1085,0,6,NULL,'Heilig is de heer God almachtig\nDe aarde is vol van uw glorie\nHeilig is de heer God almachtig\nDe aarde is vol van uw glorie (2x)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,908,NULL,NULL,'2020-01-12 20:53:37','2020-01-12 20:53:37',NULL,'Heilig is de heer God almachtig','SheetTitleContent',NULL,NULL),(1086,0,0,NULL,'Heer, Uw aangezicht wekt ontzag en eer.\nHoe heilig is Uw majesteit.\nUw heerlijkheid schijnt brandend als een vuur\nop mij\n Heilig, heilig, heilig is de Heer en God.\nGlorie, glorie, glorie aan Zijn grote naam.\nWaardig, waardig, waardig is het Lam,\ndat voor ons, dat voor ons werd geslacht.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,909,NULL,NULL,'2020-01-12 20:57:50','2020-01-12 20:57:50',NULL,'Heer, Uw aangezicht wekt ontzag en eer.','SheetTitleContent',NULL,NULL),(1087,0,1,NULL,'Heer, Uw aangezicht wekt ontzag en eer.\nHoe heilig is Uw majesteit.\nUw heerlijkheid schijnt brandend als een vuur\nop mij\n Heilig, heilig, heilig is de Heer en God.\nGlorie, glorie, glorie aan Zijn grote naam.\nWaardig, waardig, waardig is het Lam,\ndat voor ons, dat voor ons werd geslacht.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,909,NULL,NULL,'2020-01-12 20:57:50','2020-01-12 20:57:50',NULL,'Heer, Uw aangezicht wekt ontzag en eer.','SheetTitleContent',NULL,NULL),(1088,0,0,NULL,'Ik kom tot U, kniel voor U neer.\nHier is mijn leven, neem het Heer.\nIk zing dit lied tot eer van U \nopdat U zich verheugt.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,910,NULL,NULL,'2020-01-12 20:58:55','2020-01-12 20:58:55',NULL,'Ik kom tot U, kniel voor U neer.','SheetTitleContent',NULL,NULL),(1089,0,1,NULL,'Ik zoek de Gever, niet de gift.\nMijn doel en hartsverlangen is\nU te eren boven elke god\nopdat U zich verheugt.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,910,NULL,NULL,'2020-01-12 20:58:55','2020-01-12 20:58:55',NULL,'Ik zoek de Gever, niet de gift.','SheetTitleContent',NULL,NULL),(1090,0,2,NULL,'Halleluja, Halleluja\nHalleluja glorie aan Uw naam. \nHalleluja,Halleluja\nHallelua glorie aan Uw naam.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,910,NULL,NULL,'2020-01-12 20:58:55','2020-01-12 20:58:55',NULL,'Halleluja, Halleluja','SheetTitleContent',NULL,NULL),(1091,0,3,NULL,'Ik kom tot U, kniel voor U neer.\nHier is mijn leven, neem het Heer.\nIk zing dit lied tot eer van U \nopdat U zich verheugt.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,910,NULL,NULL,'2020-01-12 20:58:55','2020-01-12 20:58:55',NULL,'Ik kom tot U, kniel voor U neer.','SheetTitleContent',NULL,NULL),(1092,0,4,NULL,'Ik zoek de Gever, niet de gift.\nMijn doel en hartsverlangen is\nU te eren boven elke god\nopdat U zich verheugt.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,910,NULL,NULL,'2020-01-12 20:58:55','2020-01-12 20:58:55',NULL,'Ik zoek de Gever, niet de gift.','SheetTitleContent',NULL,NULL),(1093,0,5,NULL,'Halleluja, Halleluja\nHalleluja glorie aan Uw naam. \nHalleluja,Halleluja\nHallelua glorie aan Uw naam.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,910,NULL,NULL,'2020-01-12 20:58:55','2020-01-12 20:58:55',NULL,'Halleluja, Halleluja','SheetTitleContent',NULL,NULL),(1094,0,0,NULL,'Jezus, ik wil heel dicht bij U komen,\nin Uw nabijheid wil ‘k zijn.\nZo dicht bij U  voel ‘k Uw liefde stromen,\nU maakt mij heilig en rein.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,911,NULL,NULL,'2020-01-12 21:01:31','2020-01-12 21:01:31',NULL,'Jezus, ik wil heel dicht bij U komen,','SheetTitleContent',NULL,NULL),(1095,0,1,NULL,'In de schuilplaats van de Allerhoogste\nblijf ik onder Uw vleugels, o Heer.\nUw schaduw beschermt mij,\nUw troon is mijn toevlucht.\nU bent mijn leven, mijn eer.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,911,NULL,NULL,'2020-01-12 21:01:31','2020-01-12 21:01:31',NULL,'In de schuilplaats van de Allerhoogste','SheetTitleContent',NULL,NULL),(1096,0,2,NULL,'Jezus, ik wil heel dicht bij  U komen,\nin Uw nabijheid wil ‘k zijn.\nZo dicht bij U voel ‘k Uw liefde stromen,\nU maakt mij heilig en rein.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,911,NULL,NULL,'2020-01-12 21:01:31','2020-01-12 21:01:31',NULL,'Jezus, ik wil heel dicht bij  U komen,','SheetTitleContent',NULL,NULL),(1097,0,3,NULL,'In de schuilplaats van de Allerhoogste\nblijf ik onder Uw vleugels, o Heer.\nUw schaduw beschermt mij,\nUw troon is mijn toevlucht.\nU bent mijn leven, mijn eer.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,911,NULL,NULL,'2020-01-12 21:01:31','2020-01-12 21:01:31',NULL,'In de schuilplaats van de Allerhoogste','SheetTitleContent',NULL,NULL),(1098,0,4,NULL,'Uw schaduw beschermt mij,\nUw troon is mijn toevlucht.\nU bent mijn leven, mijn eer.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,911,NULL,NULL,'2020-01-12 21:01:31','2020-01-12 21:01:31',NULL,'Uw schaduw beschermt mij,','SheetTitleContent',NULL,NULL),(1099,0,0,NULL,'Maak mij rein voor U\nals gelouterd goud en zuiver zilver\nLaat mij zijn voor U\nals gelouterd goud, puur goud.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,912,NULL,NULL,'2020-01-12 21:02:14','2020-01-12 21:02:14',NULL,'Maak mij rein voor U','SheetTitleContent',NULL,NULL),(1100,0,1,NULL,'Dwars door het vuur\nmaakt U mij rein en puur\nIk strek mij uit, Jezus\nnaar meer van Uw Geest en Uw heiligheid',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,912,NULL,NULL,'2020-01-12 21:02:14','2020-01-12 21:02:14',NULL,'Dwars door het vuur','SheetTitleContent',NULL,NULL),(1101,0,2,NULL,'Ja ik besluit, Jezus\neen dienstknecht te zijn van U, mijn Meester\nsteeds tot Uw wil bereid.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,912,NULL,NULL,'2020-01-12 21:02:14','2020-01-12 21:02:14',NULL,'Ja ik besluit, Jezus','SheetTitleContent',NULL,NULL),(1102,0,3,NULL,'Maak mij rein voor U\nwas mijn leven schoon, vergeef mijn zonde\nLaat mij zijn voor U\nzuiver als Uw Zoon, heilig mij.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,912,NULL,NULL,'2020-01-12 21:02:14','2020-01-12 21:02:14',NULL,'Maak mij rein voor U','SheetTitleContent',NULL,NULL),(1103,0,4,NULL,'Dwars door het vuur\nmaakt U mij rein en puur\nIk strek mij uit, Jezus\nnaar meer van Uw Geest en Uw heiligheid',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,912,NULL,NULL,'2020-01-12 21:02:14','2020-01-12 21:02:14',NULL,'Dwars door het vuur','SheetTitleContent',NULL,NULL),(1104,0,5,NULL,'Ja ik besluit, Jezus\neen dienstknecht te zijn van U, mijn Meester\nsteeds tot Uw wil bereid.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,912,NULL,NULL,'2020-01-12 21:02:14','2020-01-12 21:02:14',NULL,'Ja ik besluit, Jezus','SheetTitleContent',NULL,NULL),(1105,0,0,NULL,'Verlangend wachtte ik - op mijn Heer en God\nHij kwam tot mij toen ik Hem riep\nHij richtte mij op\nHij zette mijn voeten op een rots\nen leerde mij een nieuw gezang\nEen lied van lof - tot eer van God\nKom zing en prijs Zijn naam',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,913,NULL,NULL,'2020-01-12 21:02:53','2020-01-12 21:02:53',NULL,'Verlangend wachtte ik - op mijn Heer en God','SheetTitleContent',NULL,NULL),(1106,0,1,NULL,'O Heer, wees verheven in dit huis\nDe liefde die U mij bewees\nIk twijfel nu niet meer\nO Heer, wees verheven in dit huis\nwant Uw volk is nu in harmonie\nWe loven U, we prijzen U, o Heer',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,913,NULL,NULL,'2020-01-12 21:02:53','2020-01-12 21:02:53',NULL,'O Heer, wees verheven in dit huis','SheetTitleContent',NULL,NULL),(1107,0,2,NULL,'Verlangend wachtte ik - op mijn Heer en God\nHij kwam tot mij toen ik Hem riep\nHij richtte mij op\nHij zette mijn voeten op een rots\nen leerde mij een nieuw gezang\nEen lied van lof - tot eer van God\nKom zing en prijs Zijn naam',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,913,NULL,NULL,'2020-01-12 21:02:53','2020-01-12 21:02:53',NULL,'Verlangend wachtte ik - op mijn Heer en God','SheetTitleContent',NULL,NULL),(1108,0,3,NULL,'O Heer, wees verheven in dit huis\nDe liefde die U mij bewees\nIk twijfel nu niet meer\nO Heer, wees verheven in dit huis\nwant Uw volk is nu in harmonie\nWe loven U, we prijzen U, o Heer',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,913,NULL,NULL,'2020-01-12 21:02:53','2020-01-12 21:02:53',NULL,'O Heer, wees verheven in dit huis','SheetTitleContent',NULL,NULL),(1109,0,0,NULL,'Vraag van Mij en Ik geef u de volken\nals een erfenis voor u, als een erfenis voor u.\nMijn kind’ren, vraag van Mij en ik geef u de volken\nals een erfenis voor u, vraag van Mij.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,914,NULL,NULL,'2020-01-12 21:10:06','2020-01-12 21:10:06',NULL,'Vraag van Mij en Ik geef u de volken','SheetTitleContent',NULL,NULL),(1110,0,1,NULL,'Hier ben ik, zend mij naar de volken\nals een afgezant van U, als een afgezant van U.\nMijn Vader, hier ben ik, zend mij naar de volken\nals een afgezant van U, hier ben ik.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,914,NULL,NULL,'2020-01-12 21:10:06','2020-01-12 21:10:06',NULL,'Hier ben ik, zend mij naar de volken','SheetTitleContent',NULL,NULL),(1111,0,2,NULL,'Vraag van Mij en Ik geef u de volken\nals een erfenis voor u, als een erfenis voor u.\nMijn kind’ren, vraag van Mij en ik geef u de volken\nals een erfenis voor u, vraag van Mij.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,914,NULL,NULL,'2020-01-12 21:10:06','2020-01-12 21:10:06',NULL,'Vraag van Mij en Ik geef u de volken','SheetTitleContent',NULL,NULL),(1112,0,3,NULL,'Hier ben ik, zend mij naar de volken\nals een afgezant van U, als een afgezant van U.\nMijn Vader, hier ben ik, zend mij naar de volken\nals een afgezant van U, hier ben ik.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,914,NULL,NULL,'2020-01-12 21:10:06','2020-01-12 21:10:06',NULL,'Hier ben ik, zend mij naar de volken','SheetTitleContent',NULL,NULL),(1113,0,0,NULL,'Dank U, dank U voor Uw kostbare bloed.\nDank U voor Uw offer\ndat ons de vrijheid biedt.\nDank U, U nam alle schuld van ons af.\nDaarom zingen wij nu een overwinningslied,\neen overwinningslied.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,915,NULL,NULL,'2020-01-12 21:10:50','2020-01-12 21:10:50',NULL,'Dank U, dank U voor Uw kostbare bloed.','SheetTitleContent',NULL,NULL),(1114,0,1,NULL,'Want U opent de weg naar de Vader,\nlaat Hem zien, zoals niemand Hem ziet.\nJezus, dankzij Uw trouw en genade\nzingen wij dit vreugdelied.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,915,NULL,NULL,'2020-01-12 21:10:50','2020-01-12 21:10:50',NULL,'Want U opent de weg naar de Vader,','SheetTitleContent',NULL,NULL),(1115,0,2,NULL,'Als dank voor wat U deed,\nals dank voor wat U deed,\nals dank voor wat U deed voor ons,\nleed voor ons, streed voor ons.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,915,NULL,NULL,'2020-01-12 21:10:50','2020-01-12 21:10:50',NULL,'Als dank voor wat U deed,','SheetTitleContent',NULL,NULL),(1116,0,3,NULL,'Dank U, dank U voor Uw kostbare bloed.\nDank U voor Uw offer\ndat ons de vrijheid biedt.\nDank U, U nam alle schuld van ons af.\nDaarom zingen wij nu een overwinningslied,\neen overwinningslied.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,915,NULL,NULL,'2020-01-12 21:10:50','2020-01-12 21:10:50',NULL,'Dank U, dank U voor Uw kostbare bloed.','SheetTitleContent',NULL,NULL),(1117,0,4,NULL,'Want U opent de weg naar de Vader,\nlaat Hem zien, zoals niemand Hem ziet.\nJezus, dankzij Uw trouw en genade\nzingen wij dit vreugdelied.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,915,NULL,NULL,'2020-01-12 21:10:50','2020-01-12 21:10:50',NULL,'Want U opent de weg naar de Vader,','SheetTitleContent',NULL,NULL),(1118,0,5,NULL,'Als dank voor wat U deed,\nals dank voor wat U deed,\nals dank voor wat U deed voor ons,\nleed voor ons, streed voor ons.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,915,NULL,NULL,'2020-01-12 21:10:50','2020-01-12 21:10:50',NULL,'Als dank voor wat U deed,','SheetTitleContent',NULL,NULL),(1119,0,0,NULL,'Wees stil en weet, Hij is uw God.\nIn heel de wereld zal Zijn naam worden geloofd.\nWant wie Hem zoekt, die zal Hem zien',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,916,NULL,NULL,'2020-01-12 21:23:21','2020-01-12 21:23:21',NULL,'Wees stil en weet, Hij is uw God.','SheetTitleContent',NULL,NULL),(1120,0,1,NULL,'want onze God zal nooit verlaten, wat Zijn hand begon\nAlle macht en heerschappij gaf Hij aan Zijn Zoon.\nDe satan is verslagen\nen de kerk groeit in geloof.\nZijn naam zal overal worden verhoogd.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,916,NULL,NULL,'2020-01-12 21:23:21','2020-01-12 21:23:21',NULL,'want onze God zal nooit verlaten, wat Zijn hand begon','SheetTitleContent',NULL,NULL),(1121,0,2,NULL,'Wees stil en weet, Hij is uw God.\nHij heeft Zijn Geest als levend water uitgestort.\nHet land verlangt naar Jezus’ komst.\nVoor wie gelooft heeft Hij Zijn Koninkrijk\nals erfdeel toebereid.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,916,NULL,NULL,'2020-01-12 21:23:21','2020-01-12 21:23:21',NULL,'Wees stil en weet, Hij is uw God.','SheetTitleContent',NULL,NULL),(1122,0,3,NULL,'De late regen voor de oogst\ngeeft Hij op Zijn tijd.\nLaat het vuur weer branden\nverkondig nu het Woord.\nZijn naam zal overal worden gehoord.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,916,NULL,NULL,'2020-01-12 21:23:21','2020-01-12 21:23:21',NULL,'De late regen voor de oogst','SheetTitleContent',NULL,NULL),(1123,0,0,NULL,'Over al wat leeft bent U de hoogste Heer\nAls de zon opkomt elke morgen weer\nDaarom vraag ik U, Heer van zee en land\nneem ook mijn leven in Uw hand.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,917,NULL,NULL,'2020-01-12 21:23:53','2020-01-12 21:23:53',NULL,'Over al wat leeft bent U de hoogste Heer','SheetTitleContent',NULL,NULL),(1124,0,1,NULL,'Regeer in mij met al Uw kracht\nIn mijn mooiste droom, in mijn zwartste nacht\nEr is één ding dat ik U vraag:\nO, Heer regeer in mij vandaag.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,917,NULL,NULL,'2020-01-12 21:23:53','2020-01-12 21:23:53',NULL,'Regeer in mij met al Uw kracht','SheetTitleContent',NULL,NULL),(1125,0,2,NULL,'Laat alles wat ik zeg en alles wat ik denk\nals een spiegel zijn van wie U in mij bent\nU bent zoveel meer dan ik verlangen kan\nneem ook mijn leven in Uw hand.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,917,NULL,NULL,'2020-01-12 21:23:53','2020-01-12 21:23:53',NULL,'Laat alles wat ik zeg en alles wat ik denk','SheetTitleContent',NULL,NULL),(1126,0,3,NULL,'Regeer in mij met al Uw kracht\nIn mijn mooiste droom, in mijn zwartste nacht\nEr is één ding dat ik U vraag:\nO, Heer regeer in mij vandaag.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,917,NULL,NULL,'2020-01-12 21:23:53','2020-01-12 21:23:53',NULL,'Regeer in mij met al Uw kracht','SheetTitleContent',NULL,NULL),(1127,0,4,NULL,'Regeer in mij met al Uw kracht\nIn mijn mooiste droom, in mijn zwartste nacht\nEr is één ding dat ik U vraag:\nO, Heer regeer in mij vandaag.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,917,NULL,NULL,'2020-01-12 21:23:53','2020-01-12 21:23:53',NULL,'Regeer in mij met al Uw kracht','SheetTitleContent',NULL,NULL),(1128,0,0,NULL,'Laat het feest zijn in de huizen,\nmensen juichen op de straat,\nals het onrecht buigt voor Jezus\nen het volk weer bidden gaat.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,918,NULL,NULL,'2020-01-12 21:24:36','2020-01-12 21:24:36',NULL,'Laat het feest zijn in de huizen,','SheetTitleContent',NULL,NULL),(1129,0,1,NULL,'In de bergen, door de dalen,\nhoor ons loflied, overal\nin de hemel, en op aarde\nals uw glorie komen zal.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,918,NULL,NULL,'2020-01-12 21:24:36','2020-01-12 21:24:36',NULL,'In de bergen, door de dalen,','SheetTitleContent',NULL,NULL),(1130,0,2,NULL,'Laat uw licht zien in het duister,\nals wij buigen voor het kruis.\nLaat uw heerlijkheid verschijnen\nin de wereld, in ons huis.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,918,NULL,NULL,'2020-01-12 21:24:36','2020-01-12 21:24:36',NULL,'Laat uw licht zien in het duister,','SheetTitleContent',NULL,NULL),(1131,0,3,NULL,'In de bergen, door de dalen,\nhoor ons loflied, overal\nin de hemel, en op aarde\nals uw glorie komen zal.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,918,NULL,NULL,'2020-01-12 21:24:36','2020-01-12 21:24:36',NULL,'In de bergen, door de dalen,','SheetTitleContent',NULL,NULL),(1132,0,4,NULL,'Halleluja, halleluja,\nhalleluja, halleluja.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,918,NULL,NULL,'2020-01-12 21:24:36','2020-01-12 21:24:36',NULL,'Halleluja, halleluja,','SheetTitleContent',NULL,NULL),(1133,0,5,NULL